INSERT INTO `res_didactica` (`descripcion`, `detalle`) VALUES
('actividades de fortalecimiento', 'desarrollar actividades de fortalecimiento conceptual (Talleres grupales, individuales; quz(es) rpidos, formulacin de problemas dbil y medianamente estructurados a resolver en las sesiones tericas.(APCN)'),
('aplicacin de teora en caso de estudio', 'El profesor dicta una clase Magistral y luego se hacen ejercicios sobre la clase Magistral. Dicha clase es sobre un caso de estudio. Se tiene una gua para aplicar la teora al caso de estudio. Esto sirve para cosas tericos que se pueden aplicar en algo prctico con ejercicios'),
('aprendizaje', 'Adquisicin del conocimiento de algo por medio del estudio, el ejercicio o la experiencia, en especial de los conocimientos necesarios para aprender algn arte u oficio.(APCN)'),
('bitcoras de seguimiento de clases', 'El docente al inicio del semestre propone realizar una bitcora referente a los temas vistos durante las clases de la asignatura, la cual contiene definicin de temticas y conclusiones por parte del estudiante de lo aprendido de cada temtica, fomentando de esta manera que el estudiante repase y reflexione sobre las temticas de la clase autnomamente, con revisiones peridicas de la misma. (ACS)'),
('Clases magistrales', 'Clases magistrales desarrolladas en torno a las preguntas de los estudiantes o a la\r\npresentacin de los tpicos correspondientes al curso.(APCN)'),
('clases prcticas de soporte', 'El docente presenta a los estudiantes los diferentes componentes y herramientas a usar en la prctica, guiando al estudiante para que interacte de manera fsica con los diferentes dispositivos y entienda de una mejor manera su funcionalidad y aplicacin formando al estudiante para que pueda dar un correcto soporte en caso de que as lo requiera.   (ACS)'),
('creacin de escritos y ensayos', 'Mediante el uso de la creatividad y lo explorado en clase, los estudiantes propondran escritos, ensayos o narraciones para compartir con la clase, permitiendo as una tertulia en clase donde cada uno compartir sus puntos de vista y lo plasmado en el texto, a su vez el estudiante recibir por parte del docente una correcin sobre su redaccin, coherencia y cohesin. (BC)'),
('creacin de matrices dofa (foda) para el anlisis de una empresa', 'Por bastante tiempo las matrices DOFA han sido una herramienta de anlisis para los diferentes campos administrativos, es por esto que se le pide al estudiante seleccionar una empresa de su preferencia y realizar un anlisis de dicha compaia implementando una matriz DOFA que le permita ver y entender cuales son todos los aspectos que rodean a la empresa. (BC) '),
('creacin de sistema operativo pequeo', 'Mediante lo expuesto en clase el estudiante deber encontrarse en la capacidad de crear un S.O a base de otro como lo es en el caso de Linux, el estudiante deber demostrar como funciona a nivel interno este y mostrar los conocimientos adquiridos en clase. '),
('Desarrollo de pensamiento lgico formal', 'El pensamiento formal es una etapa del desarrollo cognitivo que se inicia en los primeros aos de la adolescencia. Esta etapa se caracteriza por la capacidad para salir del presente concreto y por la capacidad para empezar a elaborar representaciones abstractas de la realidad.  (APCN)'),
('Diapositivas para explicar determinado tema', 'El profesor presenta unas diapositivas explicando su tema y adicional a esto realiza ejercicios para que quede ms claro. (AE)'),
('diseo de modelos', 'cada estudiante diseara un modelo (Conceptual y simulado) que sustentado demuestre como el problema planteado seria solucionado.(APCN)'),
('ejecucin de problemas', 'La ejecucin de problemas es bsica en el aprendizaje y por ese motivo se hace nfasis en la solucin de\r\nproblemas.(APCN)'),
('Ejemplificacion con talleres', 'El profesor prepara un tema, ejemplos sobre este tema y unos talleres. Los ejemplos son usados para resolver dudas. Y los talleres son asignados para que los estudiantes en el trabajo autnomo refuercen la tematica'),
('El estudiante expone un tema aprendido autnomamente', 'El profesor entrega a los estudiantes unas temticas y las reparte por grupos con el fin que cada grupo estudie y arme una presentacin explicando el tema. Se evala que el grupo haga aportes en cuanto a casos de aplicacin, a tecnologas e incluso anlisis sobre la importancia del tema.'),
('el estudiante repite el ejercicio con otras tecnologas', 'El profesor realiza un ejercicio de programacin y una vez es entendido por el estudiante, se le asigna la tarea de ejecutar la misma funcionalidad en otra tecnologa. Para ello, el estudiante tiene 8 dias para investigar otro lenguaje e imitar la funcionalidad vista en clase'),
('elaboracin de Artculos de investigacin', 'El docente propone la elaboracin de un artculo investigativo durante el semestre, con relacin a la materia y a la carrera; con el fin de guiar a los estudiantes a la redaccin de buenos documentos. La revisin del artculo se realiza peridicamente, para orientar y corregir al estudiante con el fin de que el documento sea de alta calidad. (ACS)'),
('elaboracin de pruebas de escritorio', 'El docente propone el desarrollo de pruebas de escritorio sobre algoritmos expuestos en clase para que el estudiante se familiarice y entienda de una mejor manera el funcionamiento del mismo para aplicaciones posteriores.  '),
('Encontrar el error de un algoritmo', 'El profesor entrega al estudiante un algoritmo con un error, el estudiante tiene media hora para encontrar el error y poner a funcionar el programa. Este tipo de tareas se deja en plena clase y puede o no ser evaluado por el profesor. Sin embargo, sirve para que el docente verifique el nivel de comprensin de sus estudiantes'),
('exponer el tema en diapositivas y proponer talleres', 'Semanalmente se expone el tema de la clase en diapositivas elaboradas anteriormente por el docente de forma detallada y didctica para la mejor comprensin del tema a ver, y tras esto se genera un taller a partir del tema visto en las diapositivas para la futura calificacin. (WR)'),
('exponer ppp', 'bro y expo tv'),
('Exponer un tema con presentaciones en el televisor o proyector', 'El profesor carga en un computador el archivo con la presentacin de la clase y proyecta la clase. A medida que avanza en cada diapositiva va explicando el tema'),
('Exposicin', 'Exposicin de principios, conceptos y herramientas bsicas en una forma clara y precisa. (APCN)'),
('Hacer preguntas sobre una lectura que se ha dejado anteriormente', 'En clases previas, el profesor ha dejado a sus estudiantes una lectura con el fin que ellos hagan el trabajo de leer y comprender los conceptos y funcionalidades expuestas en la lectura. Con el nimo de analizar el grado con el que los estudiantes logran comprender los temas de una asignatura, el profesor decide hacer preguntas claves a sus estudiantes a fin de usar las respuestas como un indicador para analizar el grado de comprensin de los estudiantes sobre el tema. La ventaja de este tipo de estrategias didcticas se encuentra no solo en evaluar si los estudiantes layeron o no, sino de medir y extraer las causas por las cuales no comprendieron un texto. El profesor con esta estrategia puede determinar las causas por las cuales no comprendieron y ver si estas causas son generales a la mayora de estudiantes y de esta forma tomar la decisin de reforzar conocimientos y/o contextos necesarios para que los estudiantes comprendan el texto'),
('Hacer un ejercicio en una tecnologa y esperar que el estudiante lo haga en otra tecnologa', 'Una de las formas ms interesantes para motivar al estudiante a la no dependencia de un lenguaje de programacin es mediante la prctica de estrategias en donde el profesor hace un ejercicio en una tecnologa y deja al estudiante la tarea de hacer el mismo ejercicio en otra tecnologa. Esta estrategia entrega al estudiante una mirada global de la tecnologa y lo prepara para aprender nuevas tecnologas, en donde la lgica inicial la tiene clara, pero le toca hacer un esfuerzo propio e individual para comprender los detalles de otro lenguaje, ya que es consciente que el nuevo lenguaje en el que el profesor le ha dejado la tarea no se ha enseado en clase, pero comprende que los principios y su dominio autnomo le preparan para perder el miedo a aprender cualquier otro lenguaje de programacin.'),
('Implementacin de la programacin para temas especficos de la clase', 'El docente propone a los estudiantes disear y desarrollar algoritmos que implementen algunas tcnicas o temticas que se les estn impartiendo en clase con el fin de fomentar a los estudiantes a que hagan uso de los conocimientos que han adquirido de las materias de programacin. Los estudiantes deben realizar programas para solucionar un tema en especfico, dichos programas son evaluados al finalizar cada corte o de acuerdo a fechas establecidas por el docente (ACS)'),
('implementar una interfaz grafica a un algoritmo', 'En algunos casos, se requiere mostrar al estudiante como la presentacin o visualizacin de datos en una interfaz grfica, entrega un carcter profesional a un estudiante y en este sentido, el profesor analiza el tipo de datos que entrega un algoritmo, las entradas que tiene y las salidas que genera y de esta forma, construye un programa que enva estos datos de entrada al algoritmo mediante una interfaz grfica y captura la salida del algoritmo para nuevamente mostrar dichos resultados en la interfaz grfica. Es muy til cuando el profesor quiere mostrar como integrar componentes hechos o como implementar patrones de visualizacin de datos o de navegacin por una serie de resultados entregados por otros componentes.'),
('Introduccin', 'Se har la correspondiente introduccin a cada tema por parte del docente. Cada alumno ha debido consultar la bibliografa dada y el material entregado por el docente, de tal manera que haciendo uso de la deduccin, o, la induccin haya la mxima participacin del grupo en cada tema abordado.(APCN)'),
('laboratorios', 'Un laboratorio brinda las herramientas y los medios necesarios para llevar a cabo experimentos, investigaciones o trabajos de carcter cientfico o tcnico. En estos espacios, las condiciones ambientales se encuentran controladas y normalizadas para evitar que se produzcan influencias extraas a las previstas que alteren las mediciones y para permitir que las pruebas sean repetibles.(APCN)'),
('lecturas y anlisis de temticas de la clase', 'El docente propone lecturas a los alumnos sobre temas acorde a la asignatura para posteriormente socializarlas en la clase y de esta manera retroalimentar ideas y aclarar posibles dudas. (ACS)'),
('Mejorar un codigo de Internet', 'Se analizan algunos cdigo fuentes en Internet y se selecciona uno de ellos para realizar mejoras estipuladas por el profesor'),
('mesa redonda', 'Los temas sern discutidos en clase a travs de mesas redondas y exposiciones, entre otras, llevando a cabo un proceso de creacin conjunta del conocimiento.(APCN)'),
('mesas redondas', 'Los temas sern discutidos en clase a travs de mesas redondas y exposiciones, entre otras, llevando a cabo un proceso de creacin conjunta del conocimiento.(APCN)'),
('modificar un programa existente', 'El profesor consigue un programa de otro autor y frente a sus estudiantes aborda el problema de realizar ajustes y modificaciones al programa para mejorar funcionalidades o para ampliar las mismas en otros contextos'),
('planeacin, gestin y creacin de un proyecto de software', ' Mediante el uso de metodologas agiles, planificar, gestar y observar la creacin de un proyecto de software desde cero, esto para que el estudiante comprenda como aplicar buenas prcticas para el desarrollo y a su vez como este se puede llevar a cabo en el mundo profesional. (BC)'),
('plantear un proyecto por grupos', 'Se desarrollara un proyecto a lo largo del semestre por grupos de 2-4 estudiantes para en este mismo aplicar las temticas de la asignatura correspondiente conforme se avance las clases, para as al final entregar un proyecto final con todas las temticas del curso aplicadas a este proyecto. (WR)'),
('Practica a partir de algunos ejercicios', 'Tras ver un tema en clase de deja un taller para la prxima clase, este taller contiene ejercicios similares a los ejemplos vistos en clase, el taller puede contar de 5 a 25 ejercicios dependiendo del tamao del tema y el plazo a entregar. (WR)'),
('Practica a partir de exmenes semanalmente', 'Semanalmente se realiza un mini examen el cual consta de 2 a 5 preguntas de los temas vistos en la semana pasada, tras recoger el examen para su futura calificacin, se dan las respuestas y se aclaran dudas de este mismo examen (WR).'),
('prctica autnoma Y TALLERES ', 'Luego de explicado el tema se dejan ejercicios que el estudiante debe realizar en su casa para reforzar lo visto en clase. Tambin se dejan talleres para entregar en una semana, que sern evaluados a partir de un quiz. (AE)'),
('Practicar a partir de mltiples ejercicios', 'El profesor explica un tema en clase. Resuelve las dudas que se tengan  plantea la resolucin de 100 ejercicios similares a los vistos en clase. El estimado inicial el tiempo para resolver los ejercicios es de 15 dias. Los ejercicios generalmente se piden a mano. (ACS)'),
('Procesos de argumentacin y de representacin', 'Procesos de argumentacin y de representacin. Con lo cual se logra la comprensin por parte del estudiante de las formas que utiliza para aproximarse a los conocimientos y la forma como da cuenta de estas aproximaciones a travs del lenguaje -oral y escrito- y de las formas de representacin que utiliza en la solucin de problema.(APCN)'),
('profundizacin de la temtica vista en clase ', 'Semanalmente se realiza la explicacin de una temtica en clase y tras esto se propone que los estudiantes profundicen acerca del tema con un taller que contenga los puntos principales a profundizar, para realizar la correccin y aclaracin de dudas en las siguiente clase.'),
('Proponer la realizacin de actividades en plataformas hechas por terceros', 'El profesor encuentra una plataforma externa, no desarrollada por el, que permite a los estudiantes desarrollar actividades. La ventaja es que estas plataformas permiten al docente ver el trabajo realizado por sus estudiantes y con ello el profesor decide si realmente el estudiante ha comprendido temas especficos.'),
('PROYECTO FINAL', 'Se llevar a cabo un proyecto final que permitir integrar los conocimientos alcanzados por los estudiantes y as complementar los temas de trabajo con lecturas y trabajos de aplicacin.(APCN)'),
('proyecto o taller de practica para exponer ', 'Tras ver el tema de la semana de dejara un taller grande o un pequeo proyecto que trate sobre la temtica vista en clase, este proyecto o taller tendrn un plazo de entrega de una semana, para su prxima exposicin al frente de todos los compaeros para realizar las respectivas correcciones.'),
('Realizacin de cdigo hecho a mano', 'Antes de empezar a programar directamente en el computador se realiza el programa en una hoja, poniendo las condicionales, los punto y coma, corchetes en diferente color para distinguirlos de las operaciones, funciones y dems cdigo. Luego teniendo en cuenta ese cdigo se aplica en la consola (AE)'),
('realizacin de programas ', 'Luego de haber explicado la temtica respecto a determinado lenguaje de programacin se deja un proyecto y ejercicios para reforzar los conocimientos presentados en clase. El proyecto puede tardar hasta un mes de duracin para su realizacin y los ejercicios para la prxima sesin. (AE)'),
('realizacin de talleres ', 'Se explica el tema y se dejan talleres para que al estudiante le quede ms claro, se da el espacio para asesora y dudas acerca de este (AE)'),
('Realizar ensayos ', 'Se coloca un ensayo de acuerdo a la temtica vista en clase para la elaboracin del mismo en su casa. Se da un tiempo estimado de una semana para su entrega.(AE)'),
('realizar exposiciones ', 'El profesor propone que los estudiantes sean los que expongan determinada temtica para que no sea solo el profesor hablando durante todas las sesiones. '),
('REPETIR EL PROCEDIMIENTO', 'El profesor hace un ejercicio. El estudiante memoriza la mecnica y luego el procedimiento con ejercicios propuestos por el profesor '),
('seminario', 'Es una reunin especializada que tiene naturaleza tcnica y acadmica cuyo objetivo es realizar un estudio profundo de determinadas materias con un tratamiento que requiere una interactividad entre los especialistas.(APCN)'),
('talleres grupales', 'Talleres, resolucin de casos y ejercicios de aplicacin en forma grupal.(APCN)'),
('trabajo autnomo', 'Trabajo autnomo es un espacio en el que el estudiante realiza lecturas previas a la clase con el fin de optimizar el\r\ntrabajo dirigido y potenciar la capacidad de comprensin del texto matemtico. (APCN)'),
('trabajo cooperativo', 'Con el trabajo cooperativo se pretende estimular al estudiante en el trabajo en equipo por medio de actividades\r\nrealizadas en grupos de mximo 3 estudiantes. (APCN)'),
('tutoras personalizadas', 'La tutora es una estrategia de apoyo al alumno para potenciar su formacin integral con una visin humanista y responsable que permite: Facilitar la adaptacin del alumno al ambiente escolar. Mejorar sus habilidades de estudio y trabajo. Abatir los ndices de reprobacin y rezago escolar.(APCN)'),
('Un estudiante explica su programa frente a los compaeros', 'El profesor revisa los trabajos de los estudiantes y observa el o los estudiantes que tienen los mejores programas y decide hablar con dicho(s) estudiantes para invitarlos a que ellos expongan como hicieron su trabajo, implementaron su algoritmo o solucionaron su problema'),
('usando induccin demostrar un teorema', 'Realizar un ejercicio con unos valores y en unos rangos y progresivamente ir aumentando el rango o los valores del ejercicio e ir analizando los resultados. Al final del ejercicio se observa un comportamiento de los resultados que puede ser descrito en forma acorde a como se muestra en la descripcin del teorema'),
('uso de colores durante la explicacin magistral', 'Mediante el uso de marcadores, lapiceros o resaltadores de diferentes colores, el docente podr resaltar de manera eficaz cmo se realiz determinado procedimiento, resaltando el origen y su resultado, de esta forma el estudiante de manera visual podr identificar ms fcilmente cmo poder aplicar esto en problemas futuros, destacando que la teora del color funciona para resaltar y fortalecer el proceso de aprendizaje. (BC)'),
('uso de simuladores', 'Mediante el uso de simuladores, el estudiante deber plantear cualquier tipo de red ya sea de tipo LAN, WAN incluso MAN, en la cual deber demostrar que sabe todo lo relacionado a enrutamiento, gestin, control y seguimiento sobre esta; adems de hacer un anlisis previo sobre qu tipo de cableado esta red debera usar, como debera conectarse y a su vez entregar un informe de esta. (BC) ');
