INSERT INTO `res_pensamiento` (`codigo`, `descripcion`, `detalle`, `link`) VALUES
(1, 'Pensamiento<br>Logico<br>.', 'Se entiende por pensamiento logico aquellas formas de razonamiento netamente relacionales, es decir, que involucran objetos reales o abstractos y una serie de relaciones entre ellos. Es un tipo de pensamiento que proviene de la propia elaboracion individual, y que requiere de la elaboracion abstracta, hipotetica.', 'https://www.redalyc.org/pdf/4418/441846101004.pdf'),
(2, 'Pensamiento<br>algoritmico<br>.', 'El pensamiento algoritmico es la capacidad para realizar el proceso de abstraccion, modelizacion de un problema, deducciones logicas y sintesis de la solucion que conduzca a escribir el algoritmo correcto.', 'https://www.scielo.cl/pdf/formuniv/v8n4/art04.pdf'),
(3, 'Pensamiento<br>Sistemico<br>.', 'Es el tipo de pensamiento o analisis con una vision sistemica, es decir, de la dinamica de sistemas, donde se busca comprender el funcionamiento desde el conjunto de las partes como un todo, a traves del metodo cientifico.', 'http://www.scielo.org.mx/scielo.php?script=sci_arttext&pid=S2007-28722020000300183&lng=es&nrm=iso'),
(4, 'Pensamiento<br>magico<br>.', 'El pensamiento magico confiere intenciones a elementos que no cuentan con voluntad ni consciencia propias, y menos aun capacidad para actuar siguiendo planes. Por ejemplo, una nina que por su corta edad cree que las olas de la playa tratan de remojarles el pelo esta utilizando el pensamiento mgico.', 'http://www.scielo.org.mx/scielo.php?script=sci_arttext&pid=S2007-74672017000200505&lng=es&nrm=iso'),
(5, 'Pensamiento<br>Suave<br>.', 'Por definicion, cuando nos referimos al proceso mental de pensamiento suave, nos referimos estrictamente al tipo de razonamiento que, entre sus caracteristicas, usa conceptos que pueden ser ambiguos o no tan claros y que suele recurrir a las metaforas. Ademas, siempre busca evitar que exista algun tipo de contradiccion. Por lo general, esta relacionado con las corrientes filosoficas postmodernas y tambien al psicoanalisis. Este concepto se contrapone totalmente al duro, el cual evoca un significado opuesto. El proceso mental de razonamiento suave es muy frecuente tambien en personas creativas que recurren a metaforas para expresar sus ideas o que, para llegar a una conclusion, realizan aproximaciones muy variadas. Y, por definicion, es uno de los pensamientos ideales que pueden existir en la etapa de busqueda de ideas frescas.', NULL),
(6, 'Pensamiento<br>Fisico<br>.', 'Pensamiento propio de ciencias como la fisica.', NULL),
(7, 'Pensamiento<br>Cultural<br>.', 'Pensamiento transcultural y cultural que le da al individuo habilidades para relacionarse con las personas, entender su cultura, contexto y relaciones de la sociedad con la persona misma.', NULL),
(8, 'Pensamiento<br>Natural<br>.', 'El primer tipo de pensamiento lineal que vamos a conocer, es el pensamiento natural. Esta forma de razonar se caracteriza por aparecer de forma espontanea. Es un modo de pensar impulsivo y por lo tanto no se utiliza ningun tipo de operacion durante el mismo.', NULL),
(9, 'Pensamiento<br>Convergente<br>.', 'En el pensamiento convergente se da un proceso por el cual nos damos cuenta de que hay diferentes hechos o realidades que encajan entre si a pesar de que en un principio parecia que no tenian nada en comun. Por ejemplo, si una familia de monarcas se da cuenta de que en una guerra les interesa ponerse a favor de uno de los bandos, habran partido del analisis de los diferentes actores en conflicto hasta llegar a una conclusion global acerca de la opcion mas conveniente.', NULL),
(10, 'Pensamiento<br>Creativo<br>.', 'En el pensamiento creativo o lateral se juega a crear soluciones originales y unicas ante problemas, mediante el cuestionamiento de las normas que en un principio parecen ser evidentes. Por ejemplo, una silla de columpio parece -predestinada- a ser utilizada en un tipo de juguete muy particular, pero es posible transgredir esta idea utilizandola como soporte para una maceta que cuelga de un porche. Este es uno de los tipos de pensamiento mas utilizados en arte y artesania.', NULL),
(11, 'Pensamiento<br>analitico<br>.', 'El pensamiento analitico crea piezas de informacion a partir de una unidad informacional amplia y llega a conclusiones viendo el modo en el que interactuan entre si estos -fragmentos-.', NULL),
(12, 'Pensamiento<br>inductivo<br>.', 'Este tipo de pensamiento no parte de afirmaciones generales, sino que se basa en casos particulares y, a partir de ellos, genera ideas generales. Por ejemplo, si observamos que las palomas tienen plumas, los avestruces tienen plumas y las garzas tambien tienen plumas, podemos concluir que estos tres animales forman parte de una categoria abstracta llamada -sauropsidos-.', NULL),
(13, 'Pensamiento<br>deductivo<br>.', 'El pensamiento deductivo parte de afirmaciones basadas en ideas abstractas y universales para aplicarlas a casos particulares. Por ejemplo, si partimos de la idea de que un frances es alguien que vive en Francia y Francia esta en Europa, concluiremos que Rene Descartes, que vivia en Francia, era europeo.', NULL),
(14, 'Pensamiento<br>Divergente<br>.', 'En el pensamiento divergente se establece una division entre dos o mas aspectos de una idea, y se explora las posibilidades de mantener esta -particion-. Por ejemplo, si alguien utiliza una misma palabra haciendo que cada vez tenga un significado distinto, detectar este error es un caso de pensamiento divergente en el que se detecta los distintos significados. Puedes ver ejemplos de esto fijandote en el uso que se hace habitualmente del concepto de -lo natural- aplicado a productos de alimentacion, orientaciones sexuales poco comunes o tendencias de comportamiento generalizadas en general.', NULL),
(15, 'Pensamiento<br>Duro<br>.', 'El pensamiento duro utiliza conceptos lo mas definidos posibles, y trata de evitar las contradicciones. Es tipico del tipo de razonamientos vinculados a la ciencia.', NULL),
(16, 'Pensamiento<br>Creativo<br>.', 'Cuando hablamos de pensamiento creativo, hacemos alusion a una forma de razonamiento tipica de los seres humanos, que es capaz de procesar y reformular la informacion de maneras originales, flexibles, plasticas y fluidas, o bien de aplicarla a la solucion de un problema con el que inicialmente no lucia compatible. Es decir que el pensamiento creativo gira en torno a la capacidad de inventiva del ser humano y de su imaginacion, las cuales permitieron desde siempre desarrollar herramientas, distintas formas de pensamiento, estrategias de supervivencia o incluso formularse complejas preguntas.', NULL),
(17, 'Pensamiento<br>Reflexivo<br>.', 'Tipo de pensamiento que consiste en darle vueltas a un tema en la cabeza y tomarselo en serio con todas sus consecuencias, es decir, el examen activo, persistente y cuidadoso de toda creencia o supuesta forma de conocimiento a la luz de los fundamentos que la sostienen y las conclusiones a las que tiende.', NULL),
(18, 'Pensamiento<br>Administrativo<br>.', 'El origen del pensamiento administrativo se remonta a aquellos tiempos en que los hombres unieron por primera vez sus esfuerzos para satisfacer sus necesidades. Sin embargo, no es sino hasta principios de este siglo que se empieza a tomar a la administracion como objeto de estudio.', NULL),
(19, 'Pensamiento<br>Critico<br>.', 'El pensamiento crtico es el proceso de dudar de las afirmaciones que en la vida cotidiana suelen aceptarse como verdaderas. Por ello, el pensamiento critico no aspira a alcanzar una verdad absoluta, sino a profundizar en practicas y estrategias que nos permiten someter nuestras convicciones, y las de otras personas, a discusiones.', NULL),
(20, 'Pensamiento<br>Interpretativo<br>.', 'Un pensamiento con alta capacidad para interpretar los resultados de un experimento o generados por la aplicacion de un procedimiento formal, explicando las causas por las cuales se producen dichos resultados.', NULL),
(21, 'Pensamiento<br>Numerico<br>Variacional', 'El pensamiento variacional es concebido como una forma dinamica de pensar que intenta producir mentalmente sistemas que relacionen sus variables internas de tal manera que covarien en forma semejante a los patrones de covariacion de cantidades, de la misma o distintas magnitudes, en los subprocesos recortados de la realidad.', NULL),
(22, 'Pensamiento<br>Matemtico', 'Pensamiento matemtico,\npues uno de los objetivos de los cursos de ciencias bsicas es lograr que el estudiante relacione el lenguaje natural con el lenguaje matemtico correctamente', NULL);
