INSERT INTO `res_resultados_de_aprendizaje` (`codigo`, `descripcion`, `detalle`) VALUES
(1, 'Algoritmo Indito', 'Mtodo til para resolver un problema empleando un dispositivo potencialmente dispuesto para tal fin. Los algoritmos deben contar con dos aspectos fundamentales: su diseo y un estudio de su eficiencia. El primero se refiere a la bsqueda de secuencias finitas de instrucciones que permitan resolver el problema y que estn adecuadas al dispositivo con el que se cuenta; el segundo permite medir el costo (en tiempo y recursos) que consume un algoritmo para encontrar la solucin, adems ofrece la posibilidad de comparar diferentes algoritmos que resuelven un mismo problema. Cuando el algoritmo es novedoso, generado por primera vez y no se ha publicado, se nombra algoritmo indito.'),
(2, 'Programa Indito', 'Un programa informtico indito es una pieza de software novedosa, no publicada, diseada por primera vez para cumplir una tarea especfica en un sistema de cmputo. Dispone de cierto margen de recursos del sistema informtico mientras se ejecuta, y cumple roles de todo tipo en el mismo, desde controlar los recursos y las operaciones internas del computador, hasta mediar con el usuario para facilitar la ejecucin de diferentes tareas. Son diseados por programadores de la informtica que componen el cdigo matriz (cdigo fuente) de cada pieza. '),
(3, 'Diagrama de Arquitectura', 'Los diagramas son una forma de representacin que sirve para estructurar informacin y sintetizar conceptos, ayudando a realizar diversos anlisis que orienten el proceso de toma de decisiones. En el campo informtico, para representar adecuadamente la arquitectura de un sistema es necesario contar con varios diagramas o vistas. Dada la cantidad de caractersticas y de elementos que tiene un sistema de software no es posible incluirlos todos en un solo diagrama, que, adems, sirva para todas las personas que participan en el desarrollo. Cada una de estas vistas es una estructura de la arquitectura del sistema que muestra una parte del mismo como un conjunto de componentes, conectores y restricciones sobre sus tipos y relaciones. En estos diagramas cada estructura puede relacionarse con las dems para complementar la visin integral del sistema. As, un diagrama de arquitectura queda conformado por diferentes visiones del sistema y constituye un modelo de cmo est estructurado dicho sistema, sirviendo de comunicacin entre las personas involucradas en el desarrollo. '),
(4, 'Documento Tcnico', 'Todo proyecto necesita uno o varios documentos tcnicos que describan su estructura, procesos a llevar a cabo o especificaciones de cada una de sus partes.\nUn documento tcnico es aquel escrito que contiene informacin organizada de forma estructurada y presentada eficazmente. Indica el propsito y una breve descripcin de cada mtodo/funcin, con su prototipo indicando argumentos (nombre, tipo, propsito de cada uno) y respuesta (tipo, descripcin). Es equivalente al manual del programador y esta dirigido a todas aquellas personas que estarn a cargo de mantener, ampliar o crear el proyecto o un subproyecto del mismo.\n\nEntre los aspectos que debe presentar estn;\n\n-  Indicar claramente como invocar el programa, conteniendo qu parmetros son opcionales, cules son obligatorios y documentar bien cul es la utilidad de cada parmetro y cul es el comportamiento por defecto si se omite algn parmetro opcional.\n-  Incorporar diagramas de flujo y explicaciones a nivel mtodo de la solucin, debe explicarse la estrategia general de resolucin donde se pueda apreciar como interactan los mdulos entre s.\n-Los tipos de datos abstractos (TDAs) deben estar adecuadamente documentados en el cdigo, por otra parte, en el manual deben constar las limitaciones que posee la representacin, cmo se representa una determinada estructura y detalle de mtodos que provee al TDA para la manipulacin de los datos.\n- Incluir una seccin de Conclusiones, donde se resumen las complicaciones encontradas durante el desarrollo, polticas adoptadas para su resolucin, restricciones al problema original, casos particulares y finalmente aspectos relacionados a la experiencia.'),
(5, 'Documento de Arquitectura', 'El Documento de Arquitectura de Software, ms conocido como SAD por sus siglas en ingls, es el documento que abarca absolutamente todo el sistema con sus dependencias y conexiones.  Habitualmente se organiza por vistas, a travs de las cuales pueden especificarse distintos aspectos tcnicos, funcionales y las decisiones involucradas en cada una de ellas. Se espera que el SAD provea informacin complementara al cdigo fuente. Se basa en el modelo de 4 + 1 vistas, planteado por Philipe Kruchten quien plantea 4 vistas: lgica, fsica, de proceso y de desarrollo, todas girando en torno a las historias de usuario o los requerimientos del cliente que constituyen la vista central.'),
(6, 'Modelo lgico de Datos', 'Un modelo lgico de datos es un modelo que describe aspectos relacionados con las necesidades de una organizacin para recopilar datos y las relaciones entre stos. Contiene representaciones de entidades y atributos, relaciones, identificadores exclusivos, subtipos y supertipos y restricciones entre relaciones. Un modelo lgico tambin puede contener objetos de modelo de dominio o referirse a uno o varios modelos de dominio o de glosario.'),
(7, 'Modelo Fisico de Datos', 'Un modelo de datos fsicos es un modelo especfico de bases de datos que representa objetos de datos relacionales (tablas, columnas, claves principales y claves externas) y sus relaciones. Un modelo de datos fsicos se puede utilizar para generar sentencias DDL que, despus, se pueden desplegar en un servidor de base de datos.'),
(8, 'Modelo de Arquitectura', 'Unaarquitectura de software, tambin denominadaarquitectura lgica, consiste en un conjunto de patrones y abstracciones coherentes que proporcionan un marco definido y claro para interactuar con el cdigo fuente delsoftware. El modelo de arquitectura forma parte del diseo del sistema a partir de los requerimientos. Es una de las etapas, incluyendo el diseo detallado, la implementacin y la verificacin. Una arquitectura de software se entiende como la estructura de un sistema, que contiene componentes, sus propiedades visibles a otros componentes y las relaciones entre ellos.\nUn sistema complejo estar formado por subsistemas. La arquitectura del Software se encarga de: Los subsistemas que componen el sistema, las interfaces y las formas en que se comunican entre ellos. Permite una comunicacin entre los interesados en el sistema, adems de la toma de decisiones tempranas para el diseo, igualmente facilita el reso de componentes.'),
(9, 'API', 'El trmino API es una abreviatura de Application Programming Interfaces, que en espaol significa interfaz de programacin de aplicaciones. Se trata de un conjunto de definiciones y protocolos que se utiliza para desarrollar e integrar el software de las aplicaciones, permitiendo la comunicacin entre dos aplicaciones de software a travs de un conjunto de reglas.'),
(10, 'Front', 'El front-end es la parte del desarrollo web que se dedica a la parte frontal de un sitio web, es decir, el diseo de un sitio web, desde la estructura del sitio hasta los estilos (colores, fondos, tamaos, animaciones y efectos). Se conoce como el lado del cliente porque es la parte de la pgina con la que interaccionan los usuarios. \nDentro del rea de front-end se trabaja con lenguajes como: HTML (lenguaje de marcado de hipertexto, se utilizan etiquetas que estructuran y organizan el contenido de la web); CSS (se encarga del formato y diseo visual de las pginas web escritas en HTML para darle estructura y estilo al sitio); Java script (lenguaje de programacin, rpido y seguro para programar centros de datos, consolas, telfonos mviles o Internet, complementa los anteriores y da dinamismo a los sitios web). HTML y CSS son lenguajes de marcado y estilo, Javascript es un lenguaje de programacin. De ellos se generan una gran cantidad de frameworks y libreras que aumentan las capacidades que se tienen para generar cualquier tipo de interfaz de usuario, como React, Redux, Angular, Bootstrap, Foundation, LESS, Sass, Stylus y PostCSS, entre otros.'),
(11, 'Middleware', 'Middleware es un software que se sita entre un sistema operativo y las aplicaciones que se ejecutan en l. Bsicamente, funciona como una capa de traduccin oculta para permitir la comunicacin y la administracin de datos en aplicaciones distribuidas. A veces, se le denomina plumbing (tuberas), porque conecta dos aplicaciones para que se puedan pasar fcilmente datos y bases de datos por una canalizacin. El uso de middleware permite a los usuarios hacer solicitudes como el envo de formularios en un explorador web o permitir que un servidor web devuelva pginas web dinmicas en funcin del perfil de un usuario.'),
(12, 'Backend', 'El back-end es la capa de acceso a los datos, ya sea de un software o de un dispositivo en general, es la lgica tecnolgica que hace que una pgina web funcione, es lo que queda oculto a ojos del visitante, procesa la informacin que alimentar el front-end de datos. El back-end de una solucin determina qu tan bien se ejecutar la aplicacin y qu experiencia positiva o negativa obtendr el usuario, en otras palabras, determina la optimizacin de recursos para que las pginas sean ligeras; esta rea es tambin la encargada de la seguridad de un sitio.\nOtras funciones que se gestionan desde el back-end son: \n- Creacin de funciones que simplifiquen el proceso de desarrollo.\n- Acciones de lgica.\n- Conexin con bases de datos.\n- Uso de libreras del servidor web.'),
(13, 'Tesis', 'Es una proposicin concreta de algn tema de inters del estudiante, generalmente relacionado con las materias de alguna disciplina de estudio de la carrera, que se plantea, analiza, verifica y concluye mediante un proceso de investigacin, acorde con el nivel de estudios de quien lo presenta.\nSe expone mediante un documento final, ante un grupo colegiado de sinodales, quienes analizan el documento y su presentacin oral, decidiendo si se otorga o no el grado en cuestin al sustentante.\nPara la realizacin de la tesis, el estudiante requiere: creatividad, conocimientos, metodologa y entusiasmo. El alumno debe ser ms participativo, innovador y debe aportar en lugar de esperar a recibir.'),
(14, 'Anteproyecto', 'Como anteproyecto podemos entender una propuesta anterior al proyecto donde se presentan las lneas fundamentales que se pretenden desarrollar posteriormente en el proyecto. Es flexible y, por tanto, caben modificaciones hasta llegar a la versin definitiva, que se convertir en proyecto. La finalidad del anteproyecto es organizar ideas y delimitar los objetivos.\nCaractersticas de un anteproyecto:\n- Suelen estar estructurados en diferentes secciones.\n-  Tienen como misin desarrollar algunas de las caractersticas que tendr el proyecto final, como problemas a abordar.\n- Son flexibles, es decir, son susceptibles de modificaciones.\n- Son escritos breves.\n- Una de sus funciones es la clarificacin de ideas para su discusin con terceras personas.'),
(15, 'Artculo', 'Es un escrito cuya finalidad esencial es comunicar los resultados de investigaciones, ideas y debates de una manera clara, concisa y fidedigna; la publicacin es uno de los mtodos inherentes al trabajo cientfico. Es preciso establecer estrategias de publicacin bien elaboradas y seguir con conocimiento de causa una serie de normas adecuadas para facilitar el intercambio entre cientficos de todos los pases y reducir a proporciones razonables el incremento del volumen de publicaciones.'),
(16, 'Diseo de Red', 'El diseo de redes cubre todos los aspectos de la infraestructura de comunicaciones, lo cual incluye redes cableadas o inalmbricas, digitales o analgicas, virtuales o fsicas, de rea local o de rea amplia, mviles/celulares y cualquier otro protocolo y escala de operacin definidos.\nExisten diferentes niveles de acuerdo con las caractersticas con las que cuenta un diseo de Red; estos diseos varan segn las configuraciones tcnicas y sus componentes hasta el diseo de principios y criterios.'),
(17, 'Diseo Elctrico', 'El diseo elctrico es el proceso de planificacin y creacin de equipos elctricos como componentes elctricos, esquemas, equipos de iluminacin, sistemas de energa e infraestructuras de telecomunicaciones. El software y las herramientas de diseo elctrico abordan los flujos de trabajo especficos de los diseadores de sistemas de controles elctricos.'),
(18, 'Planeacin Estratgica', 'La planeacin estratgica es una herramienta de gestin que permite establecer el quehacer y el camino que deben recorrer las organizaciones para alcanzar las metas previstas, teniendo en cuenta los cambios y demandas que impone su entorno. En este sentido, es una herramienta fundamental para la toma de decisiones al interior de cualquier organizacin.\n\nAs, la planificacin estratgica es un proceso de formulacin y establecimiento de objetivos y, especialmente, de los planes de accin que conducirn a lograr los objetivos. El plan estratgico de una organizacin involucra a cada miembro, lo que garantiza que las acciones individuales estn direccionadas hacia el cumplimiento de las metas a futuro.\n\nLa planeacin estratgica proporciona un marco real para comprender y evaluar la situacin de la organizacin. Ayuda a alinear al equipo con el fin de que empleen un lenguaje comn basados en la misma informacin, lo que ayudar a que surjan alternativas provechosas para la organizacin.'),
(19, 'Simulador Educativo', 'El simulador educativo es un programa que contiene un modelo de algn aspecto del mundo y que permite al estudiante cambiar ciertos parmetros o variables de entrada, ejecutar o correr el modelo y desplegar los resultados. \n\nUn simulador educativo computarizado se define como la representacin digital de un sistema real que, mediante una serie de algoritmos preestablecidos en un programa informtico, responde a las caractersticas naturales de una parte de la realidad a ser enseada. Constituye una alternativa excelente para contextualizar las actividades educativas y para ejercitar habilidades cognitivas que seran difciles de practicar de otro modo.'),
(20, 'AVA', 'Un Ambiente Virtual de Aprendizaje, es el espacio fsico donde las nuevas tecnologas tales como los sistemas Satelitales, el Internet, los multimedia, y la televisin interactiva entre otros se han potencializado rebasando al entorno escolar tradicional que favorece al conocimiento y a la apropiacin de contenidos, experiencias y procesos pedaggico-comunicacionales. Estn conformados por el espacio, el estudiante, el asesor, los contenidos educativos, la evaluacin y los medios de informacin y comunicacin.\n\nLos ambientes de aprendizaje no se circunscriben a la educacin formal, ni tampoco a una modalidad educativa particular, se trata de aquellos espacios en donde se crean las condiciones para que el individuo se apropie de nuevos conocimientos, de nuevas experiencias, de nuevos elementos que le generen procesos de anlisis, reflexin y apropiacin. Se pueden considerar como espacios virtuales en el sentido que no se llevan a cabo en un lugar predeterminado y que no requiere de la presencialidad fsica.'),
(21, 'OVA', 'Un Objeto Virtual de Aprendizaje es un conjunto de recursos digitales, auto contenible y reutilizable, con un propsito educativo y constituido por al menos tres componentes internos: contenidos, actividades de aprendizaje y elementos de contextualizacin. El Objeto Virtual de Aprendizaje debe tener una estructura de informacin externa (metadatos) que facilite su almacenamiento, identificacin y recuperacin. Su objetivo es generar conocimientos, habilidades y actitudes en funcin de las necesidades del alumno. Los OVA se disean tanto para PC de escritorio o porttil, como para dispositivos mviles como tabletas o telfonos celulares.'),
(22, 'Aplicacin Mvil', 'Una aplicacin mvil, tambin llamada App mvil, es un tipo de aplicacin diseada para ejecutarse en un dispositivo mvil, que puede ser un telfono inteligente o una tableta. Incluso si las aplicaciones suelen ser pequeas unidades de software con funciones limitadas, se las arreglan para proporcionar a los usuarios servicios y experiencias de calidad.\n\nA diferencia de las aplicaciones diseadas para computadoras de escritorio, las aplicaciones mviles se alejan de los sistemas de software integrados. En cambio, cada aplicacin mvil proporciona una funcionalidad aislada y limitada. Por ejemplo, puede ser un juego, una calculadora o un navegador web mvil.\n\nDebido a los recursos de hardware limitados de los primeros dispositivos mviles, las aplicaciones mviles evitaban la multifuncionalidad. Sin embargo, incluso si los dispositivos que se utilizan hoy en da son mucho ms sofisticados, las aplicaciones mviles siguen siendo funcionales. As es como los propietarios de aplicaciones mviles permiten a los consumidores seleccionar exactamente las funciones que deben tener sus dispositivos.'),
(23, 'Sistema Experto', 'La inteligencia artificial crea sistemas informticos que intentan simular el funcionamiento del cerebro humano a travs de las redes neuronales. Estos sistemas son desarrollados para dominar un conocimiento en particular, que en el caso de un humano u organizacin seran considerados expertos, por eso se les conoce como sistemas expertos. En otras palabras, el software de inteligencia artificial tiene el suficiente conocimiento almacenado como para resolver problemas complejos y tomar decisiones que solo un experto humano podra resolver.\n\nPero estos sistemas tambin son capaces de expresar y razonar una idea sobre algn dominio del conocimiento. Los sistemas expertos fueron los antecesores de los sistemas actuales de inteligencia artificial, aprendizaje profundo y aprendizaje automtico.\n\nLos sistemas expertos se identifican a travs de una variedad de caractersticas como por ejemplo el alto nivel de experiencia que proporciona eficiencia, precisin y resolucin imaginativa de problemas. Adems, interacta en un perodo de tiempo muy razonable con el usuario.'),
(24, 'Red Neuronal', 'Una red neuronal es un mtodo de la inteligencia artificial que ensea a las computadoras a procesar datos de una manera que est inspirada en la forma en que lo hace el cerebro humano. Se trata de un tipo de proceso de machine learning llamado aprendizaje profundo, que utiliza los nodos o las neuronas interconectados en una estructura de capas que se parece al cerebro humano. Crea un sistema adaptable que las computadoras utilizan para aprender de sus errores y mejorar continuamente. De esta forma, las redes neuronales artificiales intentan resolver problemas complicados, como la realizacin de resmenes de documentos o el reconocimiento de rostros, con mayor precisin.\n\nLas redes neuronales pueden ayudar a las computadoras a tomar decisiones inteligentes con asistencia humana limitada. Esto se debe a que pueden aprender y modelar las relaciones entre los datos de entrada y salida que no son lineales y que son complejos. Por ejemplo, pueden realizar las siguientes tareas: hacer generalizaciones y sacar conclusiones; revelar relaciones y patrones ocultos; crear sistemas de autoaprendizaje autnomos; y aprender y modelar datos muy voltiles. '),
(25, 'Ecuacin Resuelta', 'Obtener una ecuacin resuelta consiste en desarrollar las diferentes operaciones planteadas en la ecuacin para determinar el valor correspondiente a las incgnitas de la misma. Este proceso implica la reduccin de parntesis, quitar denominadores, agrupar trminos separando los que contienen incgnita de los trminos independientes, reducir trminos semejantes y despejar la incgnita.'),
(26, 'Ecuacin Planteada', 'Plantear una ecuacin es traducir un problema de un lenguaje escrito a un lenguaje matemtico. Para resolver problemas sobre planteo de ecuaciones debemos seguir los siguientes pasos:\n- Leer detenidamente y las veces necesarias el enunciado hasta comprender el problema.\n- Definir y representar simblicamente la incgnita.\n- Extraer y organizar los datos.\n- Relacionar los datos para obtener la ecuacin, es decir platear la ecuacin.'),
(27, 'Ecuacin Interpretada', 'Una vez tenemos la solucin de la ecuacin (que no es la solucin del problema), debemos interpretarla para darle un sentido, aplicar los valores de la incgnita a las diferentes situaciones identificadas al plantear la ecuacin; obteniendo as la solucin del problema.'),
(28, 'Cronograma', 'Un cronograma es una herramienta grfica que presenta un detalle de las actividades que se deben desarrollar en los tiempos establecidos, al momento que se emprende un proyecto. El objetivo de hacer un cronograma es describir de manera detallada y especfica cada una de las actividades que se deben realizar, as como los tiempos que se necesitan para llevar a buen trmino cada una de ellas. El cronograma debe detallar la fecha de inicio y de culminacin de cada fase o actividad del proyecto, debido a que lo nico que interesa es que se cumplan con los tiempos establecidos, ya que estos, deben incluir la consideracin de todos los imprevistos que se puedan presentar. En general, es importante organizar un cronograma siempre que se quiera implementar un proyecto. Esta herramienta permite primero organizar adecuadamente todas las actividades, luego poderlas ejecutar y finalmente llevar un monitoreo que logre determinar que efectivamente se desarrollan en forma ordenada y en los plazos establecidos.'),
(29, 'Plan de Negocios', 'Un plan de negocio es una herramienta de reflexin y trabajo que sirve como punto de partida para un desarrollo empresarial. Lo realiza por escrito una persona emprendedora y en l plasma sus ideas, el modo de llevarlas a cabo e indica los objetivos que alcanzar y las estrategias a utilizar. Consiste en redactar, con mtodo y orden, los pensamientos que tiene en la cabeza. Mediante el plan de negocio se evala la calidad del negocio en s. En el proceso de realizacin de este documento se interpreta el entorno de la actividad empresarial y se evalan los resultados que se obtendrn al incidir sobre esta de una determinada manera, se definen las variables involucradas en el proyecto y se decide la asignacin ptima de recursos para ponerlo en marcha.'),
(30, 'Anlisis de Riesgos', 'El anlisis del riesgo implica la consideracin de las causas y fuentes del riesgo, sus consecuencias y la probabilidad de que dichas consecuencias puedan ocurrir. Es el modelo mediante el cual se relaciona la amenaza y la vulnerabilidad de los elementos expuestos, con el fin de determinar los posibles efectos sociales, econmicos, ambientales y sus probabilidades. Se estima el valor de los daos y las prdidas potenciales y se compara con criterios de seguridad establecidos con el propsito de definir tipos de intervencin y alcance de la reduccin del riesgo y preparacin para la respuesta y recuperacin. Para ello, es necesario contar con informacin asociada a tres componentes: amenaza, exposicin y vulnerabilidad.'),
(31, 'Implementacin de una Norma', 'La implementacin de una norma es el proceso que permite desarrollar un sistema de gestin de calidad que brinde confianza a los clientes y, sobre todo, que sea til para la empresa al momento de demostrar su capacidad para proporcionar de forma coherente productos y servicios que satisfacen los requisitos del cliente y la calidad de sus productos. Las normas implementadas deben responder a estndares internacionales que favorezcan el establecimiento de procesos de fabricacin, comercio y comunicacin y con ello la obtencin de certificados de reconocimiento mundial.'),
(32, 'Plan de Calidad', 'Un Plan de Calidad es un documento que especifica qu procedimientos y recursos asociados deben aplicarse, quin debe aplicarlos y cundo deben aplicarse a un proyecto, producto, proceso o contrato especfico.'),
(33, 'Plan de Mejoramiento', 'El Plan de mejoramiento, es el instrumento que recoge y articula todas las acciones prioritarias que se emprendern para mejorar aquellas caractersticas que tendrn mayor impacto con los resultados, con el logro de los objetivos de la entidad y con el plan de accin institucional, mediante el proceso de evaluacin. El objetivo primordial del Plan de Mejoramiento es promover que los procesos internos de las entidades se desarrollen en forma eficiente y transparente a travs de la adopcin y cumplimiento de las acciones correctivas o de la implementacin de metodologas orientadas al mejoramiento continuo.'),
(34, 'Metodologa', 'La metodologa, del griego met (ms all), ods (camino) y logos (estudio), hace referencia al conjunto de procedimientos basados en principios lgicos, utilizados para alcanzar una gama de objetivos que rigen en una investigacin cientfica o en una exposicin doctrinal.\n\nLa metodologa ha obtenido diferentes definiciones o conceptos en diferentes campos y especialidades, aunque estos siempre han mantenido la esencia del concepto principal.\n\n1. Ciencia que estudia los mtodos del conocimiento.\n2. Aplicacin coherente de un mtodo. Conjunto de mtodos utilizados en la investigacin cientfica.\n3. Mtodo, conjunto de operaciones. \n4. En pedagoga, estudio de los mtodos de enseanza.'),
(35, 'Plan de Integracin', 'El Plan de Integracin es aquel que expresa los recursos, las acciones y las personas implicadas en el funcionamiento de un sistema o proyecto. Este plan se lleva a cabo por las empresas para desarrollar un plan organizado y estructurado de trabajo. Es clave para la introduccin e instalacin de sistemas de funcionamiento en busca de una eficacia general. Para desarrollar un correcto Plan de Integracin se debe tener un conocimiento pleno de los elementos relacionados. Se dejarn claros en el plan: objetivos, actividades, desarrollo, procesos y tambin los responsables de cumplir una funcin concreta.'),
(36, 'Plan de Seguridad', 'Un plan de seguridad es una herramienta construida para disminuir las vulnerabilidades e incrementar las capacidades de dar respuesta a las amenazas  o reducir su probabilidad , reduciendo as el riesgo.\n\nUn plan de seguridad permite detectar las amenazas, plantear objetivos frente a ellas, detectar qu vulnerabilidades se tienen y establecer estrategias de accin para atenderlas o disminuirlas. Gracias a este proceso se pueden determinar medidas de seguridad a implementar, establecer responsabilidades, costos y cronogramas. '),
(37, 'Juego', 'El juego es una actividad tan antigua como el hombre mismo, aunque su concepto, y su forma de practicarlo vara segn la cultura de los pueblos. El ser humano lo realiza en forma innata, producto de una experiencia placentera como resultado de un compromiso en particular, es un estmulo valioso mediante el cual el individuo se vuelve ms hbil, perspicaz, ligero, diestro, fuerte y sobre todo alegre, as lo definen Lacayo y Coello(1992).'),
(38, 'Aplicacin Stand Alone', 'Una aplicacin stand alone es aquella que no necesita ser interpretado para funcionar, ya que ese interpretador sera como otro software que tendra que estar instalado en el ordenador y por tanto el sistema no sera totalmente autnomo. Si ya se compila el software, por ejemplo, el cdigo de C y se crea el ejecutable, entonces podra ser un programa stand alone, si es que no requiere una vez compilado de otros sistemas para funcionar.'),
(39, 'Aplicacin Multiplataforma', 'Las aplicaciones multiplataforma son Apps que se caracterizan por ser creadas bajo un nico lenguaje de programacin que facilita su exportacin y por tanto su visualizacin en cualquier tipo de dispositivo independientemente de su sistema operativo. Al ser desarrolladas con un mismo lenguaje, slo son necesarios unos cambios mnimos para su completa adaptacin a cualquier dispositivo, ya sea mvil, ordenador o tablet, entre otros.\n\nEl desarrollo de aplicaciones multiplataforma se puede llevar a cabo de dos maneras:\n\n- Por un lado, a travs del uso de un lenguaje de desarrollo web como puede ser HTML5, CSS o JavaScript. De esta forma se estara desarrollando una aplicacin como si fuera una web con capacidad para adaptarse a cualquier dispositivo. \n-  Por otro lado, la creacin de aplicaciones mviles multiplataforma tambin se puede realizar con herramientas de rendering a nativo. En este caso, herramientas como Flutter o React Native que son frameworks que generan cdigo nativo para cada sistema operativo. Esto hace que la experiencia de usuario sea igual que una app nativa.'),
(40, 'Dieo de Navegacin', 'El diseo de navegacin es la estructura principal que gua a los usuarios a travs del contenido. Existen diferentes diseos que se pueden implementar en un sitio web de acuerdo con los objetivos del propietario y las necesidades de los usuarios. El diseo de navegacin vara segn sea esta: Estructurada, Principal, Local, Asociativa, Contextual, Adaptativa, entre otras.'),
(41, 'CRM', 'CRM (Customer Relationship Management) o Gestin de las relaciones con clientes, es una aplicacin que permite centralizar en una nica Base de Datos todas las interacciones entre una empresa y sus clientes. El software CRM, por definicin, permite compartir y maximizar el conocimiento de un cliente dado y de esta forma entender sus necesidades y anticiparse a ellas. Por definicin, el CRM recopila toda la informacin de las gestiones comerciales manteniendo un histrico detallado. Una solucin CRM permite dirigir y gestionar de forma ms sencilla las campaas de captacin de clientes y de fidelizacin. Gracias al CRM se puede controlar el conjunto de acciones realizadas sobre los clientes o clientes potenciales, y gestionar las acciones comerciales a partir de un cuadro de mandos detallado.'),
(42, 'Metodologia para Implementar una Norma', 'Es la estrategia que utiliza una organizacin para emprender el proceso de implementacin de una norma de calidad. Entre las posibles metodologas tenemos las siguientes:\n\n1. Planeacin estratgica: tambin llamada alineacin estratgica. A travs de este proceso, se definen la visin, misin, metas y objetivos a lograr por la organizacin, para marcar el camino a seguir por la misma.\n2. Honshi Kanri: esta es una metodologa japonesa, que lo que busca es realizar el despliegue de la estrategia. Esta herramienta consiste en definir el rumbo estratgico de la organizacin, desplegarlo en forma de cascada por los diferentes niveles y regresar para poder tener retroalimentacin para poder efectuar los pertinentes ajustes. De esta manera se logra involucrar todos los niveles.\n3. Anlisis PESAT: es un anlisis de la situacin Poltica, Econmica, Social, Ambiental y Tecnolgica. Esta herramienta nos permite clasificar desde una perspectiva de temas de inters, el propio anlisis.\n4. Anlisis FODA: bien conocido por todas las organizaciones, esta metodologa se centra en hacer un reconocimiento a nivel tanto interno, mediante la bsqueda de las fortalezas y debilidades de la organizacin, como a nivel externo, tratando de adelantarse a posibles amenazas y oportunidades. De aqu, se derivan objetivos y estrategias.\n5. Matriz MEFE (Matriz de Evaluacin de Factores Externos): esta herramienta de evaluacin es algo ms detallada, dndole al anlisis un carcter ms especfico a la vez que cuantitativo.\n6. Matriz MEFI (Matriz de Evaluacin de Factores Internos): al igual que la anterior, esta metodologa es ms detallada a la hora de analizar los factores internos y tambin aporta un carcter cuantitativo.\n7. Anlisis de los Stakeholders: mediante esta herramienta podemos identificar quines son los stakeholders o partes interesadas de nuestra organizacin y permite determinar el nivel de inters que tienen cada uno de ellos, as como la influencia que pueden tener sobre nuestra organizacin. '),
(43, 'Estudio de Viabilidad', 'Un estudio de viabilidad, tambin conocido estudio de factibilidad, perfil o preinversin, se desarrolla para determinar el xito que puede alcanzar un proyecto a partir de la evaluacin de sus aspectos tcnicos y econmicos. Se realiza para determinar el beneficio potencial que puede existir en una nueva idea. El estudio puede realizarse desde varios ngulos diferentes, de modo que todos los aspectos de la nueva idea se revisen a detalle antes de su puesta en marcha.'),
(44, 'Modelo de Optimizacin', 'Un modelo de optimizacin es la representacin matemtica de un problema real, en el cual se identifican aspectos de la realidad y se representan como frmulas. Una vez representado el problema, podemos utilizar algoritmos para encontrar rpidamente las mejores soluciones.\n\nLos modelos de optimizacin tienen 4 elementos principales: parmetros, variables, restricciones y funcin objetivo. Los parmetros son datos cuyos valores vienen dados por el problema, es decir, es lo que se conoce. Las variables son aquello sobre lo que se pide elegir y se debe decidir cules son los mejores valores para estas. La funcin objetivo, como su nombre lo dice, es el objetivo que queremos cumplir y responde a la pregunta: Qu se quiere optimizar? Con ella podemos maximizar o minimizar nuestro objetivo, por ejemplo, costos, ventas, nivel de servicio, entre otros. Por ltimo, las restricciones son las que regulan el problema y evitan que resulte una solucin imposible. Es decir, son las limitaciones o condicionantes externas que presenta el problema.'),
(45, 'Aplicacin Web', 'En la ingeniera de software se denomina aplicacin web a aquellas herramientas que los usuarios pueden utilizar accediendo a un servidor web a travs de Internet o de una intranet mediante un navegador. En otras palabras, es una aplicacin software que se codifica en un lenguaje soportado por los navegadores web en la que se confa la ejecucin al navegador. Las aplicaciones web son populares debido a lo prctico del navegador web como cliente ligero, a la independencia del sistema operativo, as como a la facilidad para actualizar y mantener aplicaciones web sin distribuir e instalar software a miles de usuarios potenciales. Existen aplicaciones como los webmails, wikis, weblogs, tiendas en lnea, etc.\n\nEs importante mencionar que una pgina Web puede contener elementos que permiten una comunicacin activa entre el usuario y la informacin. Esto garantiza que el usuario acceda a los datos de modo interactivo, gracias a que la pgina responder a cada una de sus acciones, como por ejemplo rellenar y enviar formularios, participar en juegos diversos y acceder a gestores de base de datos de todo tipo.'),
(46, 'Aplicacin Empotrada', 'Una aplicacin empotrada o embebida es aquella que interacta con el mundo fsico, su procesamiento de informacin que est integrado con procesos fsicos. Su papel principal no es la transformacin de datos, sino la interaccin con el mundo fsico. \n\nEste software se ejecuta en dispositivos distintos de una computadora personal o un servidor de cmputo. Reside en la memoria de slo lectura y se utiliza para controlar productos y sistemas de los mercados industriales y de consumo. El software embebido puede ejecutar funciones especficas, como por ejemplo el control de las teclas de un horno microondas, o suministrar una funcin significativa y con capacidad de control, funciones digitales en un automvil tales como el control de la gasolina sistema de frenado, entre otras.\n\nCualquier sistema elctrico, mecnico o qumico que incluya entradas, decisiones, clculos, anlisis y salidas es candidato para implementarse como un sistema embebido o aplicacin empotrada.'),
(47, 'Modelo Arquitectnico', 'Unaarquitectura de software, tambin denominadaarquitectura lgica, consiste en un conjunto de patrones y abstracciones coherentes que proporcionan un marco definido y claro para interactuar con el cdigo fuente delsoftware. El modelo de arquitectura forma parte del diseo del sistema a partir de los requerimientos. Es una de las etapas, incluyendo el diseo detallado, la implementacin y la verificacin. Una arquitectura de software se entiende como la estructura de un sistema, que contiene componentes, sus propiedades visibles a otros componentes y las relaciones entre ellos.\nUn sistema complejo estar formado por subsistemas. La arquitectura del Software se encarga de: Los subsistemas que componen el sistema, las interfaces y las formas en que se comunican entre ellos. Permite una comunicacin entre los interesados en el sistema, adems de la toma de decisiones tempranas para el diseo, igualmente facilita el reso de componentes.'),
(48, 'Sistema de Gestin de Conocimiento', 'Un sistema de gestin del conocimiento es cualquier herramienta o software que ayuda a almacenar y recuperar el conocimiento para un acceso y distribucin rpidos. Se utiliza para reunir todos los conocimientos e ideas en un solo lugar y de esta forma: facilitar la toma de decisiones; acceder rpidamente a la informacin; propiciar mayor colaboracin y generacin de ideas; mejorar la calidad de la informacin y los datos; y asegurar la propiedad intelectual. Entre los sistemas de gestin de conocimiento estn: Sistemas de gestin de documentos; sistemas de gestin de contenidos; Bases de datos; software de innovacin.'),
(49, 'Patrn de Diseo', 'Los patrones de diseo (design patterns) son elementos reutilizables creados para resolver problemas comunes. Con su aplicacin y utilizacin se pueden corregir diferentes problemas que presenta un cdigo, de una manera segura, estable y testeada por cientos de programadores de todo el mundo. Segn el tipo de problemas que resuelven, los patrones de diseo se clasifican en 3 categoras'),
(50, 'Propuesta de Investigacin', 'Una propuesta de investigacin es un tipo especfico de manuscrito acadmico. Su principal funcin es la comunicacin a un lector (sea una persona o una institucin) de todo lo que necesite para evaluar un proyecto de investigacin; prcticamente todas las propuestas de investigacin se redactan para un evaluador, precisando: Qu se va a investigar? Cmo se va a hacer? y En qu tiempos?\n\nEs un documento que describe un proyecto de\ntrabajo por realizar en un rea o sector de inters; y que se elabora para solicitar aprobacin, apoyo institucional y/o financiero para su ejecucin. \n\nEs producto de un proceso de trabajo que implica:\n-	Tener en cuenta las normas acadmicas, tcnicas e institucionales, internacionales y locales al momento de su elaboracin.\n-	Contar con asesora de especialistas en el rea o tema de investigacin. \n-	Atender a los formatos institucionales.'),
(51, 'Red Implementada', 'La implementacin de redes de telecomunicacin consiste en un conjunto de actividades cuyo objetivo es la realizacin de los criterios sobre las instalaciones y servicios de comunicaciones con los que se va a dotar a la infraestructura general. En la implementacin de una red deben tenerse en cuenta: Las necesidades reales de comunicacin, inversin, independencia respecto a los proveedores, la seguridad, su disponibilidad y privacidad.\n\nLas etapas que se consideran fundamentales y que se encuentran presentes en la implementacin de redes son:\n\n- Anlisis y levantamiento de informacin.\n- Diseo de la infraestructura de la red.\n- Instalacin.\n- Configuracin y entrega.\n- Monitoreo y estabilizacin de la red.                                                                                                        \n- Liberacin de la infraestructura de la red.'),
(52, 'Simulacin', 'La simulacin es una herramienta muy potente para la evaluacin y el anlisis de los sistemas nuevos y los ya existentes. Permite anticiparse al proceso real, validarlo y obtener su mejor configuracin. Es una buena herramienta de apoyo para la realizacin de mejoras y la toma de decisiones en el anlisis de cambios o avances en la logstica y los sistemas productivos. Permite reproducir virtualmente los procesos y estudiar su comportamiento para analizar el impacto de los posibles cambios o para comparar diferentes alternativas de diseo sin el alto coste de los experimentos a escala real.\n\nEl objetivo final es conseguir la mejor configuracin del proceso con un coste mnimo, maximizando la eficiencia y la productividad.'),
(53, 'Modelado Matemtico', 'El modelado matemtico es la habilidad de traducir una situacin del mundo real a la matemtica, es decir, expresar acciones o situaciones cotidianas con lenguaje matemtico, aplicar-seleccionar-evaluar modelos que\ninvolucren operatoria, identificar regularidades en expresiones numricas y geomtricas y generalizar utilizando lenguaje matemtico. Traducir expresiones en lenguaje cotidiano a lenguaje matemtico y viceversa.'),
(54, 'Plan de Gestin', 'Un plan de gestin es una herramienta para la toma de decisiones sobre la mejor forma de manejar la organizacin durante sus actividades cotidianas y a largo plazo. Incluye los mtodos convencionales de hacer diversas cosas: administrar el dinero, asumir las tareas actuales de la organizacin, abordar la forma en que las personas de la organizacin realizan su trabajo y el marco general, filosfico e intelectual en el que estos mtodos operan. Permite determinar la situacin inicial, identificar los impactos positivos y negativos del plan a realizar, establecer estrategias de gestin necesarias y definir la metodologa a emplear.'),
(55, 'Anlisis de un sistema', 'Proceso que se desarrolla con el fin de estudiar o evaluar la forma de operar de un sistema y qu problemas presenta para as poder corregir e interpretar la informacin obtenida proyectando mejoras.\nUno de sus principales objetivos es absorber los puntos importantes del sistema tomando en cuenta cada dato que se desarrolla. Permite recopilar la informacin, procesar cada base importante e interpretar su diseo final para as poder generar ideas o estrategias que dimensionen su crecimiento y desarrollo.'),
(56, 'Diseo de un Sistema', 'Proceso que se lleva a cabo para definir los elementos de un sistema, como la arquitectura, los mdulos y componentes, las diferentes interfaces de esos componentes y los datos que pasan por ese sistema. El diseo de sistemas implica un enfoque sistemtico para el diseo de un sistema. Puede adoptar un enfoque ascendente o descendente, pero de cualquier manera el proceso es sistemtico y tiene en cuenta todas las variables relacionadas del sistema que deben crearse, desde la arquitectura hasta el hardware y software necesarios, directamente a los datos y cmo viaja y se transforma a lo largo de su viaje a travs del sistema. El diseo de sistemas se superpone con el anlisis de sistemas, la ingeniera de sistemas y la arquitectura de sistemas.'),
(57, 'Estado Financiero', 'Los estados financieros son informes a travs de los cuales los usuarios de la informacin financiera perciben la realidad de las empresas y en general de cualquier organizacin econmica. Dichos informes constituyen el producto final del llamado ciclo contable. En ellos se refleja la relacin existente entre el activo, el pasivo y el patrimonio de la entidad a una fecha determinada. Para su elaboracin es importante conocer el marco conceptual vigente de las Normas Internacionales de Informacin Financiera.');
