INSERT INTO `wp_y5c34k_aioseo_notifications` (`id`, `slug`, `title`, `content`, `type`, `level`, `notification_id`, `notification_name`, `start`, `end`, `button1_label`, `button1_action`, `button2_label`, `button2_action`, `dismissed`, `new`, `created`, `updated`) VALUES
(1, '61b55cf490aac', ' Get AIOSEO Pro (65% OFF Today) + Donate for a Cause ', 'Want to boost your SEO rankings while giving back something in return?\r\n<br><br>\r\nThis Green Monday, were offering <strong><em>up to 65% OFF</em></strong> on AIOSEO Pro purchases.\r\n<br><br>\r\nAnd a portion of sales will be donated to The Conservation Fund, a non-profit that protects America\'s legacy of land and water resources through land acquisition and more.', 'success', '[\"4-x\",\"lite\"]', 183, NULL, '2021-12-13 00:00:00', '2021-12-14 00:00:00', 'Upgrade AIOSEO NOW! (65% OFF)', 'https://aioseo.com/pricing/?utm_source=WordPress&utm_campaign=green-monday-2021-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade AIOSEO NOW', NULL, NULL, 0, 0, '2021-12-12 02:22:44', '2021-12-12 02:22:44'),
(2, '61b55cf492efb', ' Introducing Our Updated Redirect Testing Tool + Enhancements to Sitemaps', 'Check out our completely revamped <strong>Redirect Testing tool</strong>! Now, you can easily test URL redirect right within your WordPress dashboard and see the status code with a single click.\r\n<br><br>\r\n<img style=\"width:100%;max-width:400px\" src=\"data:image/png;base64,\" />\r\n<br><br>\r\nWe\'ve also added a number of improvements to sitemaps, including the last generated date and a custom 404 page.\r\n<br><br>\r\nUpdate to AIOSEO 4.1.5 today and take advantage of these enhancements!', 'info', '[\"4-x\",\"lite\"]', 110, NULL, '2021-11-29 14:30:39', NULL, 'Learn More', 'https://aioseo.com/introducing-our-redirect-testing-tool-new-enhancements-to-our-sitemaps/?utm_source=WordPress&utm_campaign=redirects-testing-tool-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=redirects-testing-tool-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2021-12-12 02:22:44', '2021-12-12 02:22:44'),
(3, '623c9ef670f45', ' Announcing 4.1.8: Improved Site Redirects and Modified Date for Posts ', 'Redirects have never been easier! Our 4.1.8 update comes with a powerful feature that enables you to implement a redirect from right within a post.\r\n<br><br>\r\nWeve also added a \"limit modified date\" feature that allows you to make minor edits to posts/pages and keep the date the same.\r\n<br><br>\r\nUpdate to AIOSEO 4.1.8 today and enjoy these 2 powerful features and more.', 'success', '[\"4-x\",\"lite\"]', 241, NULL, '2022-03-01 16:19:06', NULL, 'Learn More', 'https://aioseo.com/announcing-improved-site-redirects-and-modified-date-for-posts/?utm_source=WordPress&utm_campaign=introducing-on-page-redirects-and-limit-modified-date-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=introducing-on-page-redirects-and-limit-modified-date-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2022-03-24 16:40:22', '2022-03-24 16:40:22'),
(4, '623c9ef673d34', ' Introducing IndexNow and Page Builder Integrations', 'Check out the fantastic new features in AIOSEO 4.1.7! First, we have IndexNow, a feature that gets your new or updated content indexed faster on Bing and Yandex (with more search engines to follow).\r\n<br><br>\r\nWeve also integrated AIOSEO with 3 major page builders, namely Elementor, Divi and SeedProd. Now you can work on your SEO right from within your page builder.\r\n<br><br>\r\nGet AIOSEO Pro today and up your SEO game without breaking a sweat!', 'success', '[\"4-x\",\"lite\"]', 223, NULL, '2022-03-01 16:19:06', NULL, 'Learn More', 'https://aioseo.com/introducing-indexnow-and-page-builder-integrations-in-aioseo-4-1-7/?utm_source=WordPress&utm_campaign=index-now-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=index-now-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2022-03-24 16:40:22', '2022-03-24 16:40:22'),
(5, '629f7ff0740b1', ' Introducing Crawl Cleanup and Import URLs to Your Sitemap!', 'AIOSEO 4.2.1 now allows you to manage Search Engine crawl quota by removing query args (URL parameters) from selected URLs and disabling unnecessary RSS feeds.\r\n<br><br>\r\nYou can also import bulk URLs from a CSV file to add more pages to your sitemap.\r\n<br><br>\r\nUpdate to AIOSEO 4.2.1 to take advantage of these powerful SEO features today!', 'success', '[\"4-x\",\"lite\"]', 327, NULL, '2022-05-31 21:15:05', NULL, 'Learn More', 'https://aioseo.com/introducing-crawl-cleanup-and-importing-urls-from-a-csv-file-to-your-sitemap/?utm_source=WordPress&utm_campaign=crawl-cleanup-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/pricing/?utm_source=WordPress&utm_campaign=crawl-cleanup-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro', 0, 1, '2022-06-07 16:42:24', '2022-06-07 16:42:24'),
(6, '629f7ff077dd7', ' Introducing 2 New Features!  Dashboard Widgets And Shorter URLs ', 'Weve added 2 new dashboard widgets. One to help you set up your website for better SEO and the other to show you an overview of how optimized your posts are.\r\n<br><br>\r\nAnother feature youll love is the Strip Category Base Prefix feature that enables you to create shorter URLs by removing the category base.\r\n<br><br>\r\nUpgrade to AIOSEO 4.2.0 Pro today and enjoy these powerful features on your website!!', 'success', '[\"4-x\",\"lite\"]', 308, NULL, '2022-05-31 21:15:05', NULL, 'Learn More', 'https://aioseo.com/new-dashboard-widgets-and-strip-category-base-feature/?utm_source=WordPress&utm_campaign=dashboard-widgets-strip-category-base-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=dashboard-widgets-strip-category-base-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 1, '2022-06-07 16:42:24', '2022-06-07 16:42:24');
