(55982, '_site_transient_boldgrid_gallery_version_data', 'O:8:\"stdClass\":4:{s:6:\"status\";i:200;s:7:\"message\";s:2:\"OK\";s:6:\"result\";O:8:\"stdClass\":1:{s:4:\"data\";O:8:\"stdClass\":13:{s:5:\"title\";s:16:\"BoldGrid Gallery\";s:7:\"version\";s:5:\"1.5.1\";s:8:\"asset_id\";i:1118061;s:12:\"release_date\";s:19:\"2020-07-27 20:25:23\";s:19:\"requires_wp_version\";s:3:\"4.4\";s:17:\"tested_wp_version\";s:3:\"5.8\";s:8:\"sections\";s:4012:\"{\"description\":\"<p>BoldGrid Gallery is a standalone plugin used for slideshows and galleries.<\\/p>\\n\",\"installation\":\"<ol>\\n<li><p>Upload the entire boldgrid-gallery folder to the \\/wp-content\\/plugins\\/ directory.<\\/p><\\/li>\\n<li><p>Activate the plugin through the Plugins menu in WordPress.<\\/p><\\/li>\\n<\\/ol>\\n\",\"changelog\":\"<h4>1.5.1<\\/h4>\\n\\n<ul>\\n<li>Bug fix:                      Fix update class.<\\/li>\\n<li>Bug fix:                      Trying to access array offset on value of type bool.<\\/li>\\n<\\/ul>\\n\\n<h4>1.5<\\/h4>\\n\\n<ul>\\n<li>Update:                       Bump version.<\\/li>\\n<\\/ul>\\n\\n<h4>1.4.3<\\/h4>\\n\\n<ul>\\n<li>Update:       JIRA WPB-3292   Updated plugin URI.<\\/li>\\n<\\/ul>\\n\\n<h4>1.4.2<\\/h4>\\n\\n<ul>\\n<li>Bug fix:      JIRA WPB-3161   Fixed auto plugin update.<\\/li>\\n<\\/ul>\\n\\n<h4>1.4.1<\\/h4>\\n\\n<ul>\\n<li>Bug fix:      JIRA WPB-3151   Added check and load before using get<em>plugin<\\/em>data() for updates.<\\/li>\\n<li>Update:       JIRA WPB-3112   Updated wc-gallery: 1.52 => 1.55.<\\/li>\\n<\\/ul>\\n\\n<h4>1.4<\\/h4>\\n\\n<ul>\\n<li>Bug fix:      JIRA WPB-2912   Fixed issue when installing plugins from the Tools Import page.<\\/li>\\n<\\/ul>\\n\\n<h4>1.3.1<\\/h4>\\n\\n<ul>\\n<li>Bug fix:      JIRA WPB-2892   Fixed plugin update checks for some scenarios (WP-CLI, Plesk, etc).<\\/li>\\n<li>Testing:      JIRA WPB-2744   Tested on WordPress 4.7.<\\/li>\\n<li>Misc:         JIRA WPB-2503   Added plugin requirements to readme.txt file.<\\/li>\\n<\\/ul