(55990, '_site_transient_boldgrid_ppbp_version_data', 'O:8:\"stdClass\":4:{s:6:\"status\";i:200;s:7:\"message\";s:2:\"OK\";s:6:\"result\";O:8:\"stdClass\":1:{s:4:\"data\";O:8:\"stdClass\":13:{s:5:\"title\";s:29:\"Post and Page Builder Premium\";s:7:\"version\";s:5:\"1.0.6\";s:8:\"asset_id\";i:1250159;s:12:\"release_date\";s:19:\"2022-04-27 11:09:22\";s:19:\"requires_wp_version\";s:3:\"4.7\";s:17:\"tested_wp_version\";s:3:\"5.3\";s:8:\"sections\";s:7674:\"{\"description\":\"<h4>What is the Post and Page Builder by BoldGrid?<\\/h4>\\n\\n<p>The Post and Page Builder is an intuitive drag and drop editor plugin and the easiest way to create and edit pages for any theme. Whether you are new to WordPress or consider yourself a pro, BoldGrid solutions will make your WordPress life better. Stop dealing with site-breaking shortcodes and theme restricted editors. You are going to love just how fast and easily you can create beautiful websites now.<\\/p>\\n\\n<p>Try out the <a href=\\\"https:\\/\\/www.boldgrid.com\\/central\\/get-it-now?redirect_url=wp-admin%2Fpost-new.php%3Fpost_type%3Dpage&amp;plugins=post-and-page-builder\\\">BoldGrid Demo<\\/a> on Cloud WordPress to see for yourself!<\\/p>\\n\\n<p>[youtube https:\\/\\/youtu.be\\/QoIb7OhV9ys?rel=0]<\\/p>\\n\\n<h4>Features<\\/h4>\\n\\n<ul>\\n<li><strong>Drag and Drop Editing<\\/strong> - Create simple or complex layouts with our unique editing experience<\\/li>\\n<li><strong>BoldGrid Blocks<\\/strong> - Hundreds of professional layout designs to work from<\\/li>\\n<li><strong>100% Mobile-friendly<\\/strong> - Responsive layouts and controls to change the design per device<\\/li>\\n<li><strong>Google Fonts<\\/strong> - Change font family, font size, font color, letter spacing, line height and more<\\/li>\\n<li><strong>Theme Compatibility<\\/strong> - Our WordPress Page Builder is designed to work with any WordPress Theme<\\/li>\\n<li><strong>Custom Backgrounds<\\/strong> - Add background images, gradient backgrounds, patterns, overlays, and background colors<\\/li>\\n<li><strong>Fast and Free Support<\\/strong> - Growing Community and knowledge base<\\/li>\\n<li><strong>Animations<\\/strong> - Add effects as the user scrolls down the page with Animate.css or background parallax scroll effects<\\/li>\\n<li><strong>Advanced Controls<\\/strong> - Add margin, padding, box shadows, borders, alignment and more to almost any element<\\/li>\\n<li><strong>Bootstrap Grid<\\/strong> - Drag and drop controls for bootstrap rows and columns elements<\\/li>\\n<li><strong>Add Custom CSS Classes<\\/strong> - Complete control over any element<\\/li>\\n<li><strong>Clean, Simple Markup<\\/strong> - Easily create a professionally coded template without experience<\\/li>\\n<li><strong>Google Maps<\\/strong> - Embed and customize maps into your post or page<\\/li>\\n<li><strong>Web Components<\\/strong> - High quality reusable and customizable HTML elements<\\/li>\\n<li><strong>Font Awesome Icons<\\/strong> - Insert and customize any Font Awesome icons<\\/li>\\n<li><strong>CSS Grid<\\/strong> - Full width, column and row based layouts<\\/li>\\n<li><strong>Image Editing<\\/strong> - Apply image filters and automatically crop images<\\/li>\\n<li><strong>Button Designs<\\/strong> - Fully customizable button designs<\\/li>\\n<li><strong>Custom Post Types<\\/strong> - Save and reuse full page layouts or BoldGrid Block designs<\\/li>\\n<li><strong>WordPress Editor Integration<\\/strong> - Integrated into TinyMCE so you can keep the same workflow<\\/li>\\n<li><strong>No Need for Shortcodes!<\\/strong> - Faster page loads by saving your custom HTML5 elements<\\/li>\\n<\\/ul>\\n\\n<p>Additional Features when used with other BoldGrid plugins:<\\/p>\\n\\n<ul>\\n<li>Dozens of free layout templates<\\/li>\\n<li>Integrated with professional image banks<\\/li>\\n<li>Contact Forms<\\/li>\\n<li>On-page SEO recommendations for targeted search phrase<\\/li>\\n<\\/ul>\\n\\n<p>Visit our website to learn more about additional <a href=\\\"https:\\/\\/www.boldgrid.com\\/wordpress-plugins\\/\\\">BoldGrid plugins<\\/a> to further improve your WordPress experience!<\\/p>\\n\\n<h4>People Love BoldGrid<\\/h4>\\n\\n<p>\\\"It\'s really the perfect starting point for just about any web project, allowing users to get their site up and running in very short time. \\\" - Digital.com<\\/p>\\n\\n<p>\\\"BoldGrid is a great extension to WordPress that will make my job a lot easier and faster while creating custom layouts and pages.\\\" - Webhostingmedia.net<\\/p>\\n\\n<p>\\\"Well, I have seen many site builders but this is the only one that provides so many features.\\\" - Woblogger.com<\\/p>\\n\\n<h4>A Post and Page Builder That Works With Your Theme and Plugins<\\/h4>\\n\\n<p>The Post and Page Builder by BoldGrid is designed to work with almost any WordPress theme. Add it to your existing website today, or try a BoldGrid theme for your new website. Alternatively, consider upgrading and using the powerful BoldGrid framework theme (available in Premium subscription) as an excellent time saver for agencies and developers.<\\/p>\\n\\n<h4>A Post and Page Builder Stuffed With Pre-Designed Templates &amp; Blocks<\\/h4>\\n\\n<p>Create layouts and pages faster and easier than ever with Blocks by BoldGrid. Blocks are pre-built page sections consisting of various layouts of rows and columns prepopulated with content that can be edited visually or with HTML and CSS. Blocks utilize a wide variety of content that can be completely customized to fit your needs such as icons, buttons, free and premium images, font packs, and more.<\\/p>\\n\\n<h4>A Post and Page Builder That Is Faster Than The Rest<\\/h4>\\n\\n<p>The Post and Page Builder by BoldGrid is designed to create pages that load fast. BoldGrid ditches shortcodes in favor of clean markup that can be served quickly. That also means BoldGrid code is easy to assess and customize.<\\/p>\\n\\n<h4>Coming Soon \\/ Maintenance Page<\\/h4>\\n\\n<p>Great for making \\\"under construction\\\" or \\\"coming soon\\\" pages. You can create a simple page within minutes by using free professionally designed WordPress Blocks.<\\/p>\\n\\n<h4>Bootstrap WYSIWYG Post &amp; Page Builder for WordPress<\\/h4>\\n\\n<p>Our drag and drop system is built on the Bootstrap Grid. You can drag columns, rows, and containers around your pages to make quick updates to pages.  Advanced CSS controls allow you to make pixel perfect designs.<\\/p>\\n\\n<h4>Create Custom Color Palette<\\/h4>\\n\\n<p>Choose your brand\'s colors and we\'ll help your design stay unified. Our unique color palette system is built with SASS and allows you to change all the colors on your site. You don\'t have to choose from a few presets anymore!<\\/p>\\n\",\"installation\":\"<h4>Minimum Requirements<\\/h4>\\n\\n<ul>\\n<li>PHP version 5.4 or greater<\\/li>\\n<li>WordPress 4.4 or greater<\\/li>\\n<\\/ul>\\n\\n<h4>Manually<\\/h4>\\n\\n<ol>\\n<li>Upload the entire post-and-page-builder folder to the \\/wp-content\\/plugins\\/ directory.<\\/li>\\n<li>Activate the plugin through the Plugins menu in WordPress.<\\/li>\\n<\\/ol>\\n\\n<p>You will find a \'Post and Page Builder\' menu in your WordPress admin panel and find most features within the\\nWordPress Editor.<\\/p>\\n\",\"changelog\":\"<h4>1.0.6<\\/h4>\\n\\n<p>Release date: April 26, 2022<\\/p>\\n\\n<ul>\\n<li>Fix: Slider Navigation Buttons are transparent <a href=\\\"https:\\/\\/github.com\\/BoldGrid\\/post-and-page-builder-premium\\/issues\\/7\\\">#7<\\/a><\\/li>\\n<\\/ul>\\n\\n<h4>1.0.5<\\/h4>\\n\\n<p>Release date: December 8th, 2020<\\/p>\\n\\n<ul>\\n<li>Fix: Compatibility issues with WordPress 5.6<\\/li>\\n<\\/ul>\\n\\n<h4>1.0.4<\\/h4>\\n\\n<p>Release date: November 11th, 2019<\\/p>\\n\\n<ul>\\n<li>Fix: Order posts by date instead of id.<\\/li>\\n<\\/ul>\\n\\n<h4>1.0.3<\\/h4>\\n\\n<p>Release date: October 30th, 2019<\\/p>\\n\\n<ul>\\n<li>Update: Optimizing build files.<\\/li>\\n<\\/ul>\\n\\n<h4>1.0.2<\\/h4>\\n\\n<p>Release date: December 5th, 2018<\\/p>\\n\\n<ul>\\n<li>Bug fix: Fixed updating plugin via ajax<\\/li>\\n<\\/ul>\\n\\n<h4>1.0.1<\\/h4>\\n\\n<p>Release Date: December 4th, 2018<\\/p>\\n\\n<ul>\\n<li>Bug Fix: Fixing post excerpt wrapping element<\\/li>\\n<\\/ul>\\n\\n<h4>1.0.0<\\/h4>\\n\\n<p>Release Date: October 16th, 2018<\\/p>\\n\\n<ul>\\n<li>New feature: Slider Components<\\/li>\\n<li>New feature: Post List Widget<\\/li>\\n<li>New feature: Single Post Widget<\\/li>\\n<\\/ul>\\n\"}\";s:7:\"siteurl\";s:24:\"http://www.boldgrid.com/\";s:13:\"compatibility\";s:10068:\"{\"5.6.1\":{\"1.0.5\":[100,95]},\"5.6\":{\"1.0.5\":[100,95]},\"5.5.3\":{\"1.0.5\":[100,95]},\"5.5.2\":{\"1.0.5\":[100,95]},\"5.5.1\":{\"1.0.5\":[100,95]},\"5.5\":{\"1.0.5\":[100,95]},\"5.4.4\":{\"1.0.5\":[100,95]},\"5.4.3\":{\"1.0.5\":[100,95]},\"5.4.2\":{\"1.0.5\":[100,95]},\"5.4.1\":{\"1.0.5\":[100,95]},\"5.4\":{\"1.0.5\":[100,95]},\"5.3.6\":{\"1.0.5\":[100,95]},\"5.3.5\":{\"1.0.5\":[100,95]},\"5.3.4\":{\"1.0.5\":[100,95]},\"5.3.3\":{\"1.0.5\":[100,95]},\"5.3.2\":{\"1.0.5\":[100,95]},\"5.3.1\":{\"1.0.5\":[100,95]},\"5.3\":{\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.2.9\":{\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.2.8\":{\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.2.7\":{\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.2.6\":{\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.2.5\":{\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.2.4\":{\"1.0.4\":[100,95],\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.2.3\":{\"1.0.4\":[100,95],\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.2.2\":{\"1.0.4\":[100,95],\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.2.1\":{\"1.0.4\":[100,95],\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.2\":{\"1.0.4\":[100,95],\"1.0.5\":[100,95],\"1.0.6-rc1\":[100,95],\"1.0.6\":[100,95]},\"5.1.8\":{\"1.0.5\":[100,95],\"