(56012, '_site_transient_boldgrid_api_data', 'O:8:\"stdClass\":5:{s:6:\"status\";i:200;s:7:\"message\";s:2:\"OK\";s:6:\"result\";O:8:\"stdClass\":1:{s:4:\"data\";O:8:\"stdClass\":30:{s:5:\"title\";s:21:\"BoldGrid Inspirations\";s:7:\"version\";s:5:\"2.7.4\";s:8:\"asset_id\";i:1265571;s:12:\"release_date\";s:19:\"2022-09-20 18:53:01\";s:19:\"requires_wp_version\";s:3:\"4.4\";s:17:\"tested_wp_version\";s:3:\"6.0\";s:8:\"sections\";s:50017:\"{\"description\":\"<p>BoldGrid Inspirations is an inspiration-driven plugin to assist with creating a fresh new website, or to customize an existing website.<\\/p>\\n\\n<p>The first phase is Inspiration; the guided tool creates your base website.  If you already have a website, then you can skip this step.<\\/p>\\n\\n<p>The second phase is Customization; tools to transform your website into your vision.<\\/p>\\n\",\"installation\":\"<ol>\\n<li><p>Upload the entire boldgrid-inspirations folder to the \\/wp-content\\/plugins\\/ directory.<\\/p><\\/li>\\n<li><p>Activate the plugin through the Plugins menu in WordPress.<\\/p><\\/li>\\n<li><p>You will find the Inspirations menu in your WordPress Dashboard \\/ admin panel.<\\/p><\\/li>\\n<\\/ol>\\n\",\"changelog\":\"<h4>2.7.4<\\/h4>\\n\\n<p>Release date: September 20th, 2022<\\/p>\\n\\n<ul>\\n<li>Bug Fix: background images in crio<em>page<\\/em>headers are not getting replaced <a href=\\\"https:\\/\\/github.com\\/BoldGrid\\/boldgrid-inspirations\\/issues\\/155\\\">#155<\\/a><\\/li>\\n<li>Bug Fix: Object of class WP_Error could not be converted to int <a href=\\\"https:\\/\\/github.com\\/BoldGrid\\/boldgrid-inspirations\\/issues\\/153\\\">#153<\\/a><\\/li>\\n<\\/ul>\\n\\n<h4>2.7.3<\\/h4>\\n\\n<p>Release date: September 7th, 2022<\\/p>\\n\\n<ul>\\n<li>Update: Prevent hidden categories from displaying in the sidebar during inspirations process.<\\/li>\\n<\\/ul>\\n\\n<h4>2.7.2<\\/h4>\\n\\n<p>Release date: August 8th, 2022<\\/p>\\n\\n<ul>\\n<li>Update: Increased image download timeout to 60 seconds.<\\/li>\\n<\\/ul>\\n\\n<h4>2.7.1<\\/h4>\\n\\n<p>Release date: July 8th, 2022<\\/p>\\n\\n<ul>\\n<li>Update: Updated dependencies (php 7.1).<\\/li>\\n<\\/ul>\\n\\n<h4>2.7.0<\\/h4>\\n\\n<p>Release date: July 7th, 2022<\\/p>\\n\\n<ul>\\n<li>New feature: Logo support.<\\/li>\\n<li>New feature: Nested menus.<\\/li>\\n<li>New feature: Taxonmy per post.<\\/li>\\n<li>New feature: Custom headers.<\\/li>\\n<li>Update: Updated dependencies.<\\/li>\\n<li>Update: Remove page headers on start over.<\\/li>\\n<\\/ul>\\n\\n<h4>2.6.5<\\/h4>\\n\\n<p>Release date: January 25th, 2022<\\/p>\\n\\n<ul>\\n<li>Update: Several php8 fixes.<\\/li>\\n<li>Update: Automated tests run against php 5.6, 7.4, and 8.0<\\/li>\\n<\\/ul>\\n\\n<h4>2.6.4<\\/h4>\\n\\n<p>Release date: October 18th, 2021<\\/p>\\n\\n<ul>\\n<li>Update: Add filters to allow dev installs of Crio and Crio Premium.<\\/li>\\n<\\/ul>\\n\\n<h4>2.6.3<\\/h4>\\n\\n<p>Release date: June 10th, 2021<\\/p>\\n\\n<ul>\\n<li>Update: Updated the way blogs are installed via Inspirations.<\\/li>\\n<li>Update: Updated the My Inspirations page with links to theme support.<\\/li>\\n<li>Update: Updated dependencies.<\\/li>\\n<\\/ul>\\n\\n<h4>2.6.2<\\/h4>\\n\\n<p>Release date: April 14th, 2021<\\/p>\\n\\n<ul>\\n<li>Update: Add support for footer-menu locations<\\/li>\\n<\\/ul>\\n\\n<h4>2.6.1<\\/h4>\\n\\n<p>Release date: February 16th, 2021<\\/p>\\n\\n<ul>\\n<li>Update: Disable custom menu by default.<\\/li>\\n<li>Bug fix: Add \\\"My Inspirations\\\" link in case js does not redirect.<\\/li>\\n<\\/ul>\\n\\n<h4>2.6.0<\\/h4>\\n\\n<p>Release date: January 25th, 2021<\\/p>\\n\\n<ul>\\n<li>New feature: Theme deployments can now include theme specific plugins.<\\/li>\\n<\\/ul>\\n\\n<h4>2.5.2<\\/h4>\\n\\n<p>Release date: December 8th, 2020<\\/p>\\n\\n<ul>\\n<li>Bug fix: Fixed Gutenberg detection, avoid errors when adding media.<\\/li>\\n<li>Bug fix: Avoid js errors when editor screens have no ability to add media.<\\/li>\\n<\\/ul>\\n\\n<h4>2.5.1<\\/h4>\\n